import {createTheme} from '@mui/material/styles';

const theme = createTheme({
    palette: {
    primary: {
        light: '#757ce8',
        main: '#71996a',
        dark: '#cd9849',
        contrastText: '#cd9849',
    },
    secondary: {
        light: '#edcc9b',
        main: '#eddea3',
        dark: '#4e7248',
        contrastText: '#4e7248',
    },
    },
});

export default theme;
